2:"created_time";i:1599258631;}i:81;a:1:{s:7:"caption";s:1504:"Flashback Friday Post. Many years ago, I was part of a two man show titled Found in Darkness with @goya_goon in San Francisco at a gallery formerly known as Book and Job. I was neck deep in a series of work that was deeply steeped in long running narrative body of work that existed in an imagined post apocalyptic future where I raised what continue to be some very pertinent and important questions about humanity, our survival as a species, climate change and social justice, our inability to reckon with our own self destructive obsessions as a collective whole, and what a reset of society would look like where we are no longer the dominant species in a world we have made nearly unlivable for our needs. This is the installation I created at that show as a living moment within this world of my imagined future. This is one of only a few photos I still have of this show. I am proud of this work and will return to it in new ways of imagining it beyond that which I have previously explored. Working with @goya_goon is always an honor and I hope I get to do so for the rest of my life as an artist.
